export const sideBarAction = () => async (dispatch, getState)=>{
    try{
        // dispatch({state:getState()})
        
        const state = getState()
        console.log(state)
        const current = state.SideBarStatus.status
        console.log(current)
        console.log(!current)
        dispatch({type: 'hai', payload:!current})
    }catch(error){

    }
}
